import React from "react";
import Products from "./Products";
import { Link, Route, Routes } from "react-router-dom";
import Fruits from "./Fruits";
import Vegetable from "./Vegetable";

const UserHome = () => {
  return (
    <div>

      <div className="container-fluid">
        <div className="row mt-3 mx-2">
          {
            //list-Group Here
          }
          <div className="col-md-3">
            <div className="list-group mt-4">
              <Link to="/"className="list-group-item list-group-item-action active">
                All Products
              </Link>
              <Link to="/fruits" className="list-group-item list-group-item-action">
                Fruits
              </Link>
              <Link to="/vegetable" className="list-group-item list-group-item-action">
                Vegetable
              </Link>
              <a href="#!" className="list-group-item list-group-item-action">
                Drinks
              </a>
            </div>
          </div>
          <div className="col-md-9">

          <Routes>
        <Route path="/" element={<Products />} />
        <Route path="/fruits" element={<Products />} />
        <Route path="/vegetable" element={<Vegetable/>} />

      </Routes>

          </div>
        </div>
      </div>
    </div>
  );
};
export default UserHome;
